78     template <typename T, typename...>
79     struct native_value_maker
80     {
81         template <typename... Args>
82         TOML_NODISCARD
83         static T make(Args&&... args) noexcept(std::is_nothrow_constructible_v<T, Args&&...>)
84         {
85             if constexpr (std::is_aggregate_v<T>)
86                 return T{ static_cast<Args&&>(args)... };
87             else
88                 return T(static_cast<Args&&>(args)...);
89         }
90     };
91 
92     template <typename T>
93     struct native_value_maker<T, T>
94     {
95         template <typename U>
96         TOML_NODISCARD
97         TOML_ALWAYS_INLINE
98         static U&& make(U&& val) noexcept
99         {
100             return static_cast<U&&>(val);
101         }
102     };
103 
