106     struct string_maker
107     {
108         template <typename T>
109         TOML_NODISCARD
110         static std::string make(T&& arg) noexcept
111         {
112             using arg_type = std::decay_t<T>;
113 #if TOML_HAS_CHAR8
114             if constexpr (is_one_of<arg_type, char8_t*, const char8_t*>)
115             {
116                 return std::string(reinterpret_cast<const char*>(static_cast<const char8_t*>(arg)));
117             }
118             if constexpr (is_one_of<arg_type, std::u8string, std::u8string_view>)
119             {
120                 return std::string(reinterpret_cast<const char*>(static_cast<const char8_t*>(arg.data())),
121                                    arg.length());
122             }
123 #endif
124 
125 #if TOML_ENABLE_WINDOWS_COMPAT
126             if constexpr (is_wide_string<arg_type>)
127             {
128                 return narrow(static_cast<T&&>(arg));
129             }
130 #endif
131         }
132     };
133 
