166     template <typename T>
167     TOML_CONST_GETTER
168     inline optional<T> node_integer_cast(int64_t val) noexcept
169     {
170         static_assert(node_type_of<T> == node_type::integer);
171         static_assert(!is_cvref<T>);
172 
173         using traits = value_traits<T>;
174         if constexpr (!traits::is_signed)
175         {
176             if constexpr ((sizeof(T) * CHAR_BIT) < 63) // 63 bits == int64_max
177             {
178                 using common_t = decltype(int64_t{} + T{});
179                 if (val < int64_t{} || static_cast<common_t>(val) > static_cast<common_t>(traits::max))
180                     return {};
181             }
182             else
183             {
184                 if (val < int64_t{})
185                     return {};
186             }
187         }
188         else
189         {
190             if (val < traits::min || val > traits::max)
191                 return {};
192         }
193         return { static_cast<T>(val) };
194     }
195 }
