391         template <typename ElemType = void>
392         TOML_PURE_GETTER
393         bool is_homogeneous() const noexcept
394         {
395             using type = impl::remove_cvref<impl::unwrap_node<ElemType>>;
396             static_assert(std::is_void_v<type> || toml::is_value<type> || toml::is_container<type>,
397                           "The template type argument of value::is_homogeneous() must be void or one "
398                           "of:" TOML_SA_UNWRAPPED_NODE_TYPE_LIST);
399 
400             if constexpr (std::is_void_v<type>)
401                 return true;
402             else
403                 return impl::node_type_of<type> == impl::node_type_of<value_type>;
404         }
