774         TOML_PURE_GETTER
775         friend bool operator==(const value& lhs, value_arg rhs) noexcept
776         {
777             if constexpr (std::is_same_v<value_type, double>)
778             {
779                 const auto lhs_nan = impl::fpclassify(lhs.val_) == impl::fp_class::nan;
780                 const auto rhs_nan = impl::fpclassify(rhs) == impl::fp_class::nan;
781                 if (lhs_nan != rhs_nan)
782                     return false;
783                 if (lhs_nan)
784                     return true;
785             }
786             return lhs.val_ == rhs;
787         }
788         TOML_ASYMMETRICAL_EQUALITY_OPS(const value&, value_arg, );
