841         friend bool operator>=(value_arg lhs, const value& rhs) noexcept
842         {
843             return lhs >= rhs.val_;
844         }
845 
852         template <typename T>
853         TOML_PURE_GETTER
854         friend bool operator==(const value& lhs, const value<T>& rhs) noexcept
855         {
856             if constexpr (std::is_same_v<value_type, T>)
857                 return lhs == rhs.val_; // calls asymmetrical value-equality operator defined above
858             else
859                 return false;
860         }
861 
868         template <typename T>
869         TOML_PURE_INLINE_GETTER
870         friend bool operator!=(const value& lhs, const value<T>& rhs) noexcept
871         {
872             return !(lhs == rhs);
873         }
874 
884         template <typename T>
885         TOML_PURE_GETTER
886         friend bool operator<(const value& lhs, const value<T>& rhs) noexcept
887         {
888             if constexpr (std::is_same_v<value_type, T>)
889                 return lhs.val_ < rhs.val_;
890             else
891                 return impl::node_type_of<value_type> < impl::node_type_of<T>;
892         }
893 
903         template <typename T>
904         TOML_PURE_GETTER
905         friend bool operator<=(const value& lhs, const value<T>& rhs) noexcept
906         {
907             if constexpr (std::is_same_v<value_type, T>)
908                 return lhs.val_ <= rhs.val_;
909             else
910                 return impl::node_type_of<value_type> <= impl::node_type_of<T>;
911         }
912 
922         template <typename T>
923         TOML_PURE_GETTER
924         friend bool operator>(const value& lhs, const value<T>& rhs) noexcept
925         {
926             if constexpr (std::is_same_v<value_type, T>)
927                 return lhs.val_ > rhs.val_;
928             else
929                 return impl::node_type_of<value_type> > impl::node_type_of<T>;
930         }
931 
941         template <typename T>
942         TOML_PURE_GETTER
943         friend bool operator>=(const value& lhs, const value<T>& rhs) noexcept
944         {
945             if constexpr (std::is_same_v<value_type, T>)
946                 return lhs.val_ >= rhs.val_;
947             else
948                 return impl::node_type_of<value_type> >= impl::node_type_of<T>;
949         }
950 
952 
953 #if TOML_ENABLE_FORMATTERS
954 
958         friend std::ostream& operator<<(std::ostream& lhs, const value& rhs)
959         {
960             impl::print_to_stream(lhs, rhs);
961             return lhs;
962         }
963 
964 #endif
965     };
