969     template <typename T>
970     value(T) -> value<impl::native_type_of<impl::remove_cvref<T>>>;
971 
972     template <typename T>
973     TOML_NODISCARD
974     inline decltype(auto) node::get_value_exact() const noexcept(impl::value_retrieval_is_nothrow<T>)
975     {
976         using namespace impl;
977 
978         static_assert(node_type_of<T> != node_type::none);
979         static_assert(node_type_of<T> != node_type::table);
980         static_assert(node_type_of<T> != node_type::array);
981         static_assert(is_native<T> || can_represent_native<T>);
982         static_assert(!is_cvref<T>);
983         TOML_ASSERT(this->type() == node_type_of<T>);
984 
985         if constexpr (node_type_of<T> == node_type::string)
986         {
987             const auto& str = *ref_cast<std::string>();
988             if constexpr (std::is_same_v<T, std::string>)
989                 return str;
990             else if constexpr (std::is_same_v<T, std::string_view>)
991                 return T{ str };
992             else if constexpr (std::is_same_v<T, const char*>)
993                 return str.c_str();
994 
995             else if constexpr (std::is_same_v<T, std::wstring>)
996             {
997 #if TOML_ENABLE_WINDOWS_COMPAT
998                 return widen(str);
999 #else
1000                 static_assert(dependent_false<T>, "Evaluated unreachable branch!");
1001 #endif
1002             }
1003 
1004 #if TOML_HAS_CHAR8
1005 
1006             // char -> char8_t (potentially unsafe - the feature is 'experimental'!)
1007             else if constexpr (is_one_of<T, std::u8string, std::u8string_view>)
1008                 return T(reinterpret_cast<const char8_t*>(str.c_str()), str.length());
1009             else if constexpr (std::is_same_v<T, const char8_t*>)
1010                 return reinterpret_cast<const char8_t*>(str.c_str());
1011             else
1012                 static_assert(dependent_false<T>, "Evaluated unreachable branch!");
1013 
1014 #endif
1015         }
1016         else
1017             return static_cast<T>(*ref_cast<native_type_of<T>>());
1018     }
1019 
1020     template <typename T>
1021     TOML_NODISCARD
1022     inline optional<T> node::value_exact() const noexcept(impl::value_retrieval_is_nothrow<T>)
1023     {
1024         using namespace impl;
1025 
1026         static_assert(!is_wide_string<T> || TOML_ENABLE_WINDOWS_COMPAT,
1027                       "Retrieving values as wide-character strings with node::value_exact() is only "
1028                       "supported on Windows with TOML_ENABLE_WINDOWS_COMPAT enabled.");
1029 
1030         static_assert((is_native<T> || can_represent_native<T>)&&!is_cvref<T>,
1031                       TOML_SA_VALUE_EXACT_FUNC_MESSAGE("return type of node::value_exact()"));
1032 
1033         // prevent additional compiler error spam when the static_assert fails by gating behind if constexpr
1034         if constexpr ((is_native<T> || can_represent_native<T>)&&!is_cvref<T>)
1035         {
1036             if (type() == node_type_of<T>)
1037                 return { this->get_value_exact<T>() };
1038             else
1039                 return {};
1040         }
1041     }
1042 
1043     template <typename T>
1044     TOML_NODISCARD
1045     inline optional<T> node::value() const noexcept(impl::value_retrieval_is_nothrow<T>)
1046     {
1047         using namespace impl;
1048 
1049         static_assert(!is_wide_string<T> || TOML_ENABLE_WINDOWS_COMPAT,
1050                       "Retrieving values as wide-character strings with node::value() is only "
1051                       "supported on Windows with TOML_ENABLE_WINDOWS_COMPAT enabled.");
1052         static_assert((is_native<T> || can_represent_native<T> || can_partially_represent_native<T>)&&!is_cvref<T>,
1053                       TOML_SA_VALUE_FUNC_MESSAGE("return type of node::value()"));
1054 
1055         // when asking for strings, dates, times and date_times there's no 'fuzzy' conversion
1056         // semantics to be mindful of so the exact retrieval is enough.
1057         if constexpr (is_natively_one_of<T, std::string, time, date, date_time>)
1058         {
1059             if (type() == node_type_of<T>)
1060                 return { this->get_value_exact<T>() };
1061             else
1062                 return {};
1063         }
1064 
1065         // everything else requires a bit of logicking.
1066         else
1067         {
1068             switch (type())
1069             {
1070                 // int -> *
1071                 case node_type::integer:
1072                 {
1073                     // int -> int
1074                     if constexpr (is_natively_one_of<T, int64_t>)
1075                     {
1076                         if constexpr (is_native<T> || can_represent_native<T>)
1077                             return static_cast<T>(*ref_cast<int64_t>());
1078                         else
1079                             return node_integer_cast<T>(*ref_cast<int64_t>());
1080                     }
1081 
1082                     // int -> float
1083                     else if constexpr (is_natively_one_of<T, double>)
1084                     {
1085                         const int64_t val = *ref_cast<int64_t>();
1086                         if constexpr (std::numeric_limits<T>::digits < 64)
1087                         {
1088                             constexpr auto largest_whole_float = (int64_t{ 1 } << std::numeric_limits<T>::digits);
1089                             if (val < -largest_whole_float || val > largest_whole_float)
1090                                 return {};
1091                         }
1092                         return static_cast<T>(val);
1093                     }
1094 
1095                     // int -> bool
1096                     else if constexpr (is_natively_one_of<T, bool>)
1097                         return static_cast<bool>(*ref_cast<int64_t>());
1098 
1099                     // int -> anything else
1100                     else
1101                         return {};
1102                 }
1103 
1104                 // float -> *
1105                 case node_type::floating_point:
1106                 {
1107                     // float -> float
1108                     if constexpr (is_natively_one_of<T, double>)
1109                     {
1110                         if constexpr (is_native<T> || can_represent_native<T>)
1111                             return { static_cast<T>(*ref_cast<double>()) };
1112                         else
1113                         {
1114                             const double val = *ref_cast<double>();
1115                             if (impl::fpclassify(val) == fp_class::ok
1116                                 && (val < (std::numeric_limits<T>::lowest)() || val > (std::numeric_limits<T>::max)()))
1117                                 return {};
1118                             return { static_cast<T>(val) };
1119                         }
1120                     }
1121 
1122                     // float -> int
1123                     else if constexpr (is_natively_one_of<T, int64_t>)
1124                     {
1125                         const double val = *ref_cast<double>();
1126                         if (impl::fpclassify(val) == fp_class::ok
1127                             && static_cast<double>(static_cast<int64_t>(val)) == val)
1128                             return node_integer_cast<T>(static_cast<int64_t>(val));
1129                         else
1130                             return {};
1131                     }
1132 
1133                     // float -> anything else
1134                     else
1135                         return {};
1136                 }
1137 
1138                 // bool -> *
1139                 case node_type::boolean:
1140                 {
1141                     // bool -> bool
1142                     if constexpr (is_natively_one_of<T, bool>)
1143                         return { *ref_cast<bool>() };
1144 
1145                     // bool -> int
1146                     else if constexpr (is_natively_one_of<T, int64_t>)
1147                         return { static_cast<T>(*ref_cast<bool>()) };
1148 
1149                     // bool -> anything else
1150                     else
1151                         return {};
1152                 }
1153             }
1154 
1155             // non-values, or 'exact' types covered above
1156             return {};
1157         }
1158     }
1159 
1160     template <typename T>
1161     TOML_NODISCARD
1162     inline auto node::value_or(T && default_value) const noexcept(impl::value_retrieval_is_nothrow<T>)
1163     {
1164         using namespace impl;
1165 
1166         static_assert(!is_wide_string<T> || TOML_ENABLE_WINDOWS_COMPAT,
1167                       "Retrieving values as wide-character strings with node::value_or() is only "
1168                       "supported on Windows with TOML_ENABLE_WINDOWS_COMPAT enabled.");
1169 
1170         if constexpr (is_wide_string<T>)
1171         {
1172 #if TOML_ENABLE_WINDOWS_COMPAT
1173 
1174             if (type() == node_type::string)
1175                 return widen(*ref_cast<std::string>());
1176             return std::wstring{ static_cast<T&&>(default_value) };
1177 
1178 #else
1179 
1180             static_assert(dependent_false<T>, "Evaluated unreachable branch!");
1181 
1182 #endif
1183         }
1184         else
1185         {
1186             using value_type =
1187                 std::conditional_t<std::is_pointer_v<std::decay_t<T>>,
1188                                    std::add_pointer_t<std::add_const_t<std::remove_pointer_t<std::decay_t<T>>>>,
1189                                    std::decay_t<T>>;
1190             using traits = value_traits<value_type>;
1191 
1192             // clang-format off
1193 
1194             static_assert(
1195                 traits::is_native || traits::can_represent_native || traits::can_partially_represent_native,
1196                 "The default value type of node::value_or() must be one of:"
1197                 TOML_SA_LIST_NEW "A native TOML value type"
1198                 TOML_SA_NATIVE_VALUE_TYPE_LIST
1199 
1200                 TOML_SA_LIST_NXT "A non-view type capable of losslessly representing a native TOML value type"
1201                 TOML_SA_LIST_BEG "std::string"
1202                 #if TOML_ENABLE_WINDOWS_COMPAT
1203                 TOML_SA_LIST_SEP "std::wstring"
1204                 #endif
1205                 TOML_SA_LIST_SEP "any signed integer type >= 64 bits"
1206                 TOML_SA_LIST_SEP "any floating-point type >= 64 bits"
1207                 TOML_SA_LIST_END
1208 
1209                 TOML_SA_LIST_NXT "A non-view type capable of (reasonably) representing a native TOML value type"
1210                 TOML_SA_LIST_BEG "any other integer type"
1211                 TOML_SA_LIST_SEP "any floating-point type"
1212                 TOML_SA_LIST_END
1213 
1214                 TOML_SA_LIST_NXT "A compatible view type"
1215                 TOML_SA_LIST_BEG "std::string_view"
1216                 #if TOML_HAS_CHAR8
1217                 TOML_SA_LIST_SEP "std::u8string_view"
1218                 #endif
1219                 #if TOML_ENABLE_WINDOWS_COMPAT
1220                 TOML_SA_LIST_SEP "std::wstring_view"
1221                 #endif
1222                 TOML_SA_LIST_SEP "const char*"
1223                 #if TOML_HAS_CHAR8
1224                 TOML_SA_LIST_SEP "const char8_t*"
1225                 #endif
1226                 #if TOML_ENABLE_WINDOWS_COMPAT
1227                 TOML_SA_LIST_SEP "const wchar_t*"
1228                 #endif
1229                 TOML_SA_LIST_END
1230             );
1231 
1232             // clang-format on
1233 
1234             // prevent additional compiler error spam when the static_assert fails by gating behind if constexpr
1235             if constexpr (traits::is_native || traits::can_represent_native || traits::can_partially_represent_native)
1236             {
1237                 if constexpr (traits::is_native)
1238                 {
1239                     if (type() == node_type_of<value_type>)
1240                         return *ref_cast<typename traits::native_type>();
1241                 }
1242                 if (auto val = this->value<value_type>())
1243                     return *val;
1244                 if constexpr (std::is_pointer_v<value_type>)
1245                     return value_type{ default_value };
1246                 else
1247                     return static_cast<T&&>(default_value);
1248             }
1249         }
1250     }
